import React from 'react';

export default class AddProduct extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            productName: "",
            productPrice: null,
        };
    }

    render() {
        return(
            <div className='AddProduct'>
                <p>{"Add Product"}</p>
                {"Name: "} <input type="text" />
                {"Price: "} <input type="number" />
            </div>
        );
    }
}
